import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

function App() {
  return (
    <div>
      <Header />

      {/* HERO SECTION */}
      <div className='h-[98vh] bg-[#000000]'>
        <video
          src={process.env.PUBLIC_URL + '/accpaivideo.mp4'}
          controls={false}
          // poster={process.env.PUBLIC_URL + '/1063×680-01.jpg'}
          autoPlay
          muted
          playsInline
        />
        {/* <video src={process.env.PUBLIC_URL + '/accpaivideo.mp4'} /> */}
        {/*  poster={process.env.PUBLIC_URL + '/1063×680-01.jpg'} */}
      </div>
    </div>
  );
}

export default App;
